import React from "react";
import styled from "styled-components";

function Footer() {
  //css section
  const Wrapper = styled.div`
    background-color: rgb(185, 133, 133);
    display: flex;
    align-items: center;
    justify-content: center;
    /* height: 5vh; */

    p {
      font-weight: bold;
    }
  `;
  return (
    <Wrapper>
      <div>
        <div className="icon">
          <i className="fa fa-facebook"></i>
        </div>
      </div>
      <p className="text-light">Created by Idokoken, All Right Reserved</p>
    </Wrapper>
  );
}

export default Footer;
